<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Patient Data Entry</title>

    <style>
        body {
            font-family: Arial, sans-serif;
            padding: 20px;
            background-color: #f4f4f9;
            width: 100vw;
            height: 100vh;
            overflow: hidden;
            display: flex;
            justify-content: center;
            align-items: center;
            flex-direction: column;
        }
        .bg {
            position: absolute;
            top: 0;
            left: 0;
            width: 100vw;
            height: 100vh;
            z-index: -1;
            opacity: 0.45;
        }

        h1 {
            text-align: center;
            color: #fff;
        }

        form {
            width: 30vw;
            max-height: 80vh;
            margin: 0 auto;
            background-color: #ffffff9e;
            padding: 20px;
            border-radius: 5px;
            box-shadow: 0 2px 5px rgba(0, 0, 0, 0.455);
            backdrop-filter: blur(8px);
            display: flex;
            flex-direction: column;
            overflow-y: auto;
        }

        label {
            display: block;
            margin-bottom: 10px;
            font-weight: bold;
            color: #333;
        }

        input[type="text"],
        input[type="number"],
        select {
            width: 95%;
            padding: 10px;
            margin-bottom: 15px;
            border: 1px solid #ccc;
            border-radius: 3px;
            font-size: 16px;
        }

        button[type="submit"] {
            background-color: #4CAF50;
            color: #fff;
            padding: 10px 20px;
            border: none;
            border-radius: 3px;
            cursor: pointer;
            font-size: 16px;
        }

        button[type="submit"]:hover {
            background-color: #45a049;
        }
    </style>
    
</head>

    <h1>ENTER PATIENT DETAILS</h1>
    <form method="POST" action="/">
        <label>Passkey (Numeric):</label><br>
        <input type="text" name="passkey" required><br><br>

        <label>Patient Name:</label><br>
        <input type="text" name="name" required><br><br>

        <label>Phone Number:</label><br>
        <input type="text" name="phone" required><br><br>

        <label>Age:</label><br>
        <input type="number" name="age" required><br><br>

        <label>Blood Group:</label><br>
        <input type="text" name="blood_group" required><br><br>

        <label>Cholesterol Level:</label><br>
        <input type="number" step="0.1" name="cholesterol_level" required><br><br>

        <label>Sugar Level:</label><br>
        <input type="number" step="0.1" name="sugar_level" required><br><br>

        <label>Accident History (Yes/No):</label><br>
        <select name="accident_history" required>
            <option value="">Select an option</option>
            <option value="Yes">Yes</option>
            <option value="No">No</option>
        </select><br><br>

        <label>Surgery History (Yes/No):</label><br>
        <select name="surgery_history" required>
            <option value="">Select an option</option>
            <option value="Yes">Yes</option>
            <option value="No">No</option>
        </select><br><br>

        <button type="submit">Submit</button>
    </form>
